//import logo from './logo.svg';
import './App.css';
import Header from "./components/Header";
import CharCard from "./components/CharCard";
import Character from "./characters.json"
class App extends Component {


  render() {
    return <div>
      <Header />
      <CharCard 
      image={Character[0].image}/>
      </div>;
  };
}

export default App;
